import React from "react";

const MissionList = (props) => {
  console.log(props.missionList);
  return (
    <div className="py-5 px-4">
      <ul className="-my-5 divide-y divide-gray-200">
        {props.missionList.map((mission) => (
          <li key={mission.id} className="py-5">
            {console.log(mission)}
            <div className="grid grid-cols-6">
              <div className="border col-span-5">
                <p>
                  Type : {mission.missionType.name}
                  Qty : {mission.quantity}
                  VINs : {mission.vins}
                  Pick-up address : {mission.pickUp}
                  Drop-off address : {mission.dropOff}
                  Fleet : {mission.fleet}
                  Comment : {mission.comment}
                </p>
              </div>
              <div className="border col-span-1 place-self-center">
                <a
                  href="#"
                  className="inline-flex items-center shadow-sm px-2.5 py-0.5 border border-red-300 text-sm leading-5 font-medium rounded-full text-red-700 bg-white hover:bg-red-50"
                >
                  Delete
                </a>
              </div>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};
export default MissionList;
